// import { BrowserRouter, Router } from 'react-router-dom';
import './App.css';
import NavBar from './Components/NavBar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
function App() {
  return (
    <>
      <Router>
        <NavBar />
        <Switch path='/' exact>
          Route
        </Switch>
      </Router>
    </>
  );
}

export default App;
